pragma solidity ^0.8.4;

import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract BWLBadgeFactory is ERC1155, Ownable {
    uint256 public count;

    string public name;
    string public symbol;

    mapping(uint => string) public tokenURI;

    constructor() ERC1155("") {
        count = 0;
        name = "BWLItems";
        symbol = "BWLI";
    }

    // Action
    // External
    function mintWithUri(address _to, uint _id, uint _amount, string memory _uri) external {
        _mint(_to, _id, _amount, "");
        setURI(_id, _uri);
        count++;
    }

    function mintBatchWithUri(address _to, uint[] memory _ids, uint[] memory _amounts, string[] memory _uris) external {
        _mintBatch(_to, _ids, _amounts, "");
        for(uint i = 0; i < _ids.length; i++) {
            setURI(_ids[i], _uris[i]);
            count++;
        }
    }

    function burn(uint _id, uint _amount) external {
        _burn(msg.sender, _id, _amount);
    }

    function burnBatch(uint[] memory _ids, uint[] memory _amounts) external {
        _burnBatch(msg.sender, _ids, _amounts);
    }

    function burnForMint(address _from, uint[] memory _burnIds, uint[] memory _burnAmounts, uint[] memory _mintIds, uint[] memory _mintAmounts) external onlyOwner {
        _burnBatch(_from, _burnIds, _burnAmounts);
        _mintBatch(_from, _mintIds, _mintAmounts, "");
    }

    // Utils
    function setURI(uint _id, string memory _uri) public {
        tokenURI[_id] = _uri;
        emit URI(_uri, _id);
    }

    // View
    function totalSupply() public view returns (uint256) {
        return count;
    }

    function uri(uint _id) public override view returns (string memory) {
        return tokenURI[_id];
    }
}
